import React from "react";
import TraitCard from "./Trait"; // Import the existing TraitCard component

const styles = {
  traitStack: {
    position: "relative",
    width: "300px",
    height: "250px", // Adjust height to fit the staggered cards
  },
};

const TraitStack = ({ traits }) => (
  <div style={styles.traitStack}>
    {traits.map((trait, index) => (
      <div
        key={index}
        style={{
          position: "absolute",
          top: `${index * 20}px`, // Stagger cards vertically
          left: `${index * 10}px`, // Stagger cards horizontally
        }}
      >
        <TraitCard
          text={trait.text}
          iconSrc={trait.iconSrc}
          color={trait.color}
        />
      </div>
    ))}
  </div>
);

export default TraitStack;
